import React, {Component} from 'react'


class DogsList extends Component {

    render() {
        const {URL} = this.props;
        const body = document.createElement('ol');
        for (var key in URL) {
            body.appendChild(`<li>${key}</li>`)
        }
       // console.log(URL);

        return (
            <div>
                {body}

            </div>
        )
    }

}

export default DogsList;
